import React from 'react';
import { Container, Row, Col, Nav, Image } from 'react-bootstrap';
import NavBar from './Navbar';
import '../css/home.css';
import {Link} from 'react-router-dom';

export default function Home(){
    return (
        <>
            <NavBar />
            <Container fluid>
                <Row>
                    <Col xs={2} className="mt-4">
                    <Image className="image" src="https://www.aflac.com/_global-assets/images/business/small-business-hub/sbh-articles/aflac-voluntary-benefits-101.jpg"/>
                        <hr/>
                    <Nav defaultActiveKey="/home" className="mt-5 flex-column">
                        <Nav.Link>
                            <Link to="/home"><span class="fas fa-tasks"> <span className="ml-4">Investments</span></span></Link>
                        </Nav.Link>
                        <Nav.Link>Link</Nav.Link>
                        <Nav.Link>Link</Nav.Link>
                        
                        </Nav>
                    </Col>

                </Row>
            </Container>
        </>
    );
}
